import React, { useEffect, useState } from "react";
import Link from "next/link";
import Layout from "../components/Layout";

export default function Index() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/posts")
      .then((response) => {
        return response.json();
      })
      .then((json) => {
        setData(json);
      });
  });

  return (
    <Layout>
      <div className='p-4 shadow-lg rounded text-blue-green'>
        <h1 className='text-purple-500 blue-green'>Next.js</h1>
        <p className='text-gray-500 bg-secondary text-primary'>
          with Tailwind CSSSS
        </p>
        {data.map((item) => {
          return (
            <div>
              <Link href={`/aukcje/${item.id}`}>{item.title}</Link>
            </div>
          );
        })}
        <Link href='/about' title='About Page'>
          <a>About Page</a>
        </Link>
      </div>
    </Layout>
  );
}
